был(а) давно’s comment: 1 Производная:
\frac{dr}{d\theta} = \frac{a(1 - e^2)e\sin\theta}{(1 + e\cos\theta)^2}
---
2 Минимальное и максимальное расстояние:
\sin\theta = 0 \Rightarrow
\begin{cases}
\theta = 0 \Rightarrow r_{\text{min}} = a(1 - e), \\
\theta = \pi \Rightarrow r_{\text{max}} = a(1 + e)
\end{cases}
---
3 Скорости (по астрофизике):
v_{\text{min}} = \sqrt{GM\left(\frac{2}{a(1+e)} - \frac{1}{a}\right)}, \quad
v_{\text{max}} = \sqrt{GM\left(\frac{2}{a(1-e)} - \frac{1}{a}\right)}

